import React from "react";
import GNB from "./components/GNB";
import "./HomePage.css";

const HomePage = () => {
  return (
    <div className="home-page">
      <GNB />
      <div className="group-section">
        <div className="group-toggle">
          <button className="toggle-button active">공개</button>
          <button className="toggle-button">비공개</button>
          <input
            type="text"
            placeholder="그룹명을 검색해 주세요"
            className="group-search"
          />
        </div>
        <div className="group-content">
          <div className="no-group">
            <img src="path/to/your/placeholder-image.png" alt="No Groups" />
            <p>등록된 공개 그룹이 없습니다.</p>
            <p>가장 먼저 그룹을 만들어보세요!</p>
          </div>
          <button className="create-group-button">그룹 만들기</button>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
